#pragma once

const int MAX_SIZE = 1000;
typedef unsigned int uint;

struct PhoneNumber {
	string zipCode;
	string digits;
};

struct Date {
	uint date;
	uint month;
	uint year;
};

struct Subscription {
	uint id;
	string fullName;
	string address;
	PhoneNumber phoneNumber;
	Date contractDate;
};

typedef Subscription Subscriptions[MAX_SIZE];

template <typename V>
class HashTable {
public:
	uint n;

	V get(string key) {
		int hashIndex = hash(key);
		int originalHashIndex = hashIndex;
		while (keys[hashIndex] != key) {
			hashIndex++;
			hashIndex %= n;
			if (hashIndex == originalHashIndex) return -1;
		}
		return values[hashIndex];
	}

	void put(string key, V value) {
		int hashIndex = hash(key);
		while (keys[hashIndex] != "") {
			hashIndex++;
			hashIndex %= n;
		}
		keys[hashIndex] = key;
		values[hashIndex] = value;
		n++;
	}

	void update(string key, V value) {
		int hashIndex = hash(key);
		int originalHashIndex = hashIndex;
		while (keys[hashIndex] != key) {
			hashIndex++;
			hashIndex %= n;
			if (hashIndex == originalHashIndex) return;
		}
		values[hashIndex] = value;
	}

	void entries() {
		for (int i = 0; i < n; i++) {
			if (keys[i] != "")
				cout << setw(15) << keys[i]
				<< setw(10) << get(keys[i]) << endl;
		}
	}

	HashTable<V>(uint size) {
		n = size;
	}

private:
	string keys[MAX_SIZE];
	V values[MAX_SIZE];

	int hash(string key) {
		return key.length() % n;
	}
};
